            var typeId = "test-type-complete";
            var responseJson = @"{
                ""id"": ""test-type-complete"",
                ""name"": ""custom_user_type"",
                ""displayName"": ""Custom User Type"",
                ""description"": ""A custom user type for testing"",
                ""default"": false,
                ""created"": ""2024-01-15T10:30:00.000Z"",
                ""createdBy"": ""admin@test.okta.com"",
                ""lastUpdated"": ""2024-10-25T14:45:00.000Z"",
                ""lastUpdatedBy"": ""admin@test.okta.com"",
                ""_links"": {
                    ""schema"": {
                        ""rel"": ""schema"",
                        ""href"": ""https://test.okta.com/api/v1/meta/schemas/user/" + typeId + @""",
                        ""method"": ""GET""
                    },
                    ""self"": {
                        ""rel"": ""self"",
                        ""href"": ""https://test.okta.com/api/v1/meta/types/user/" + typeId + @""",
                        ""method"": ""GET""
                    }
                }
            }";

            var mockClient = new MockAsyncClient(responseJson);
            var userTypeApi = new UserTypeApi(mockClient, new Configuration { BasePath = "https://test.okta.com" });

            // Act
            var result = await userTypeApi.GetUserTypeAsync(typeId);

            // Assert - Verify all properties that were part of the SDK bug fix
            result.Should().NotBeNull();
            result.Id.Should().Be("test-type-complete");
            result.Name.Should().Be("custom_user_type"); // Was missing before fix
            result.DisplayName.Should().Be("Custom User Type"); // Was missing before fix
            result.Description.Should().Be("A custom user type for testing"); // Was missing before fix
            result.Default.Should().BeFalse(); // Was missing before fix
            result.Created.Should().BeAfter(DateTimeOffset.MinValue); // Was missing before fix
            result.LastUpdated.Should().BeAfter(DateTimeOffset.MinValue); // Was missing before fix
            result.Links.Should().NotBeNull();
            
            mockClient.ReceivedPath.Should().Be("/api/v1/meta/types/user/{typeId}");
            mockClient.ReceivedPathParams.Should().ContainKey("typeId");
            mockClient.ReceivedPathParams["typeId"].Should().Contain(typeId);
        }

